  `desc` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '表单描述',
  `head_type` tinyint(1) unsigned DEFAULT '1' COMMENT '1图片2轮播3视频',
