-- ----------------------------
-- Table structure for jshop_order
-- ----------------------------
DROP TABLE IF EXISTS `jshop_order`;
CREATE TABLE `jshop_order` (
  `order_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '订单号',
  `shop_id` int(11) DEFAULT NULL,
  `goods_amount` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '商品总价',
  `payed` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '已支付的金额',
  `order_amount` decimal(10,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '订单实际销售总额',
  `pay_status` tinyint(1) unsigned DEFAULT '1' COMMENT '支付状态 1=未付款 2=已付款 3=部分付款 4=部分退款 5=已退款',
  `ship_status` tinyint(1) unsigned DEFAULT '1' COMMENT '发货状态 1=未发货 2=部分发货 3=已发货 4=部分退货 5=已退货',
  `status` tinyint(1) unsigned DEFAULT '1' COMMENT '订单状态 1=正常 2=完成 3=取消',
  `payment_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '支付方式代码',
  `payment_time` bigint(12) DEFAULT NULL COMMENT '支付时间',
  `logistics_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '配送方式ID 关联ship.id',
  `logistics_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '配送方式名称',
  `cost_freight` decimal(6,2) unsigned DEFAULT '0.00' COMMENT '配送费用',
  `user_id` int(10) unsigned DEFAULT NULL COMMENT '用户ID 关联user.id',
  `seller_id` int(10) unsigned DEFAULT NULL COMMENT '店铺ID 关联seller.id',
  `confirm` tinyint(1) unsigned DEFAULT '1' COMMENT '售后状态 1=未确认收货 2=已确认收货',
  `confirm_time` bigint(12) unsigned DEFAULT NULL COMMENT '确认收货时间',
  `store_id` int(10) unsigned DEFAULT '0' COMMENT '自提门店ID，0就是不门店自提',
  `ship_area_id` int(10) unsigned DEFAULT '0' COMMENT '收货地区ID',
  `ship_address` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '收货详细地址',
  `ship_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '收货人姓名',
  `ship_mobile` char(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '收货电话',
  `weight` double(10,2) unsigned DEFAULT '0.00' COMMENT '商品总重量',
  `tax_type` tinyint(1) unsigned DEFAULT '1' COMMENT '是否开发票 1=不发票 2=个人发票 3=公司发票',
  `tax_content` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT '商品详情' COMMENT '发票内容',
  `tax_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '税号',
  `tax_title` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '发票抬头',
  `point` int(10) unsigned DEFAULT NULL COMMENT '使用积分',
  `point_money` decimal(10,2) DEFAULT NULL COMMENT '积分抵扣金额',
  `order_pmt` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '订单优惠金额',
  `goods_pmt` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '商品优惠金额',
  `coupon_pmt` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '优惠券优惠额度',
  `coupon` varchar(5000) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '优惠券信息',
  `promotion_list` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '优惠信息',
  `memo` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '买家备注',
  `ip` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '下单IP',
  `mark` varchar(510) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '卖家备注',
  `source` tinyint(3) unsigned NOT NULL DEFAULT '1' COMMENT '订单来源 1=PC页面 2=H5页面 3=微信小程序',
  `is_comment` tinyint(1) unsigned NOT NULL DEFAULT '1' COMMENT '是否评论，1未评论，2已评论',
  `ctime` bigint(12) unsigned DEFAULT NULL COMMENT '创建时间',
  `utime` bigint(12) unsigned DEFAULT NULL COMMENT '更新时间',
  `isdel` bigint(12) unsigned DEFAULT NULL COMMENT '删除标志 有数据表示删除',
  `parent_order_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '总订单id',
  `is_coupon` tinyint(1) DEFAULT '0' COMMENT '是否优惠卷购买 默认0不是1是',
  UNIQUE KEY `order_id` (`order_id`,`shop_id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT COMMENT='订单表';
-- ----------------------------
-- Records of jshop_order
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_order_items
-- ----------------------------
DROP TABLE IF EXISTS `jshop_order_items`;
CREATE TABLE `jshop_order_items` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `order_id` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL COMMENT '订单ID 关联order.id',
  `goods_id` int(10) unsigned DEFAULT NULL COMMENT '商品ID 关联goods.id',
