-- ----------------------------
-- Table structure for jshop_salable_record
-- ----------------------------
DROP TABLE IF EXISTS `jshop_salable_record`;
CREATE TABLE `jshop_salable_record` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '单价id',
  `money` decimal(10,3) DEFAULT '0.000' COMMENT '单价',
  `type` smallint(1) DEFAULT '4' COMMENT '币种 默认 4 积分币种',
  `ctime` bigint(12) DEFAULT NULL COMMENT '添加时间',
  `utime` bigint(12) DEFAULT NULL COMMENT '更改时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC;
-- ----------------------------
-- Records of jshop_salable_record
