-- ----------------------------
-- Table structure for jshop_ship
-- ----------------------------
DROP TABLE IF EXISTS `jshop_ship`;
CREATE TABLE `jshop_ship` (
  `id` int(11) unsigned NOT NULL AUTO_INCREMENT,
  `shop_id` int(11) unsigned DEFAULT NULL,
  `name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '配送方式名称',
  `has_cod` tinyint(1) unsigned DEFAULT '1' COMMENT '是否货到付款 1=不是货到付款 2=是货到付款',
  `firstunit` mediumint(8) unsigned DEFAULT NULL COMMENT '首重',
  `continueunit` mediumint(8) unsigned DEFAULT NULL COMMENT '续重',
  `def_area_fee` tinyint(1) unsigned DEFAULT '1' COMMENT '按地区设置配送费用是否启用默认配送费用 1=启用 2=不启用',
  `type` tinyint(1) unsigned DEFAULT '1' COMMENT '地区类型 1=全部地区 2=指定地区',
  `firstunit_price` decimal(10,2) unsigned DEFAULT NULL COMMENT '首重费用',
  `continueunit_price` decimal(10,2) unsigned DEFAULT NULL COMMENT '续重费用',
  `exp` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '配送费用计算表达式',
  `logi_name` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '物流公司名称',
  `logi_code` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '物流公司编码',
  `is_def` tinyint(1) unsigned DEFAULT '2' COMMENT '是否默认 1=默认 2=不默认',
  `sort` smallint(5) unsigned DEFAULT '100' COMMENT '配送方式排序 越小越靠前',
  `status` tinyint(1) unsigned DEFAULT '1' COMMENT '状态 1=正常 2=停用',
  `free_postage` tinyint(1) unsigned DEFAULT '2' COMMENT '是否包邮，1包邮，2不包邮',
  `area_fee` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '地区配送费用',
  `goodsmoney` decimal(20,2) DEFAULT '0.00' COMMENT '商品总额满多少免运费',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `id` (`id`) USING BTREE,
  KEY `sort` (`sort`) USING BTREE,
  KEY `sort_2` (`sort`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10006 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT COMMENT='配送方式表';
-- ----------------------------
-- Records of jshop_ship
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_shop
-- ----------------------------
DROP TABLE IF EXISTS `jshop_shop`;
CREATE TABLE `jshop_shop` (
  `id` int(11) NOT NULL AUTO_INCREMENT COMMENT '店铺id',
  `user_id` int(10) unsigned NOT NULL COMMENT '会员id',
  `linkman` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '联系人姓名',
  `mobile` varchar(20) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '手机号',
  `address` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '详细地址',
  `coordinate` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '坐标',
  `password` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '密码',
  `name` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '店铺名称',
  `info` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '店铺简介',
  `is_verify` tinyint(4) NOT NULL DEFAULT '0' COMMENT '是否已审核 0为审核  1已通过 2拒绝',
  `vtime` bigint(20) DEFAULT NULL COMMENT '审核时间',
  `ctime` bigint(20) NOT NULL COMMENT '添加时间',
  `logo` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '店铺图片',
  `type` tinyint(4) NOT NULL DEFAULT '1' COMMENT ' 店铺类型  1企业0个人',
  `money` decimal(10,2) DEFAULT '0.00' COMMENT '店铺账户',
  `lat` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '纬度',
  `lng` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '经度',
  PRIMARY KEY (`id`) USING BTREE,
  KEY `user_id` (`user_id`) USING BTREE,
  CONSTRAINT `jshop_shop_ibfk_3` FOREIGN KEY (`user_id`) REFERENCES `jshop_user` (`id`) ON DELETE RESTRICT ON UPDATE CASCADE
) ENGINE=InnoDB AUTO_INCREMENT=16 DEFAULT CHARSET=utf8 ROW_FORMAT=DYNAMIC COMMENT='店铺表，通过我要开店申请';
