-- ----------------------------
-- Table structure for jshop_user
-- ----------------------------
DROP TABLE IF EXISTS `jshop_user`;
CREATE TABLE `jshop_user` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `username` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '用户名',
  `password` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '密码 md5(md5()+创建时间)',
  `password2` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '支付密码',
  `mobile` varchar(15) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '手机号',
  `sex` tinyint(1) unsigned DEFAULT '3' COMMENT '1=男 2=女 3=未知',
  `birthday` date DEFAULT NULL COMMENT '生日',
  `avatar` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '头像',
  `nickname` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '昵称',
  `balance` decimal(10,2) DEFAULT '0.00' COMMENT '余额',
  `point` decimal(10,2) unsigned DEFAULT '0.00' COMMENT '积分',
  `grade` tinyint(2) unsigned DEFAULT '0' COMMENT '用户等级',
  `ctime` bigint(12) unsigned DEFAULT NULL,
  `utime` bigint(12) unsigned DEFAULT NULL,
  `status` tinyint(1) unsigned DEFAULT '1' COMMENT '1 = 正常 2 = 停用',
  `pid` int(10) unsigned DEFAULT '0' COMMENT '推荐人',
  `isdel` bigint(12) unsigned DEFAULT NULL COMMENT '删除标志 有数据就是删除',
  `isshop` tinyint(4) DEFAULT '0' COMMENT ' 是否开通店铺  0未开通 1已开通 2审核中',
  `shop_money` decimal(10,2) DEFAULT '0.00' COMMENT '店铺账户  已废除不用了',
  `otayonii` int(11) DEFAULT '0' COMMENT '金豆',
  `coupon` int(10) DEFAULT '0' COMMENT '购物卷个数',
  `pay_passwd` int(6) DEFAULT NULL COMMENT '支付密码',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10149 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT COMMENT='用户表';
