-- Table structure for jshop_user_tocash
-- ----------------------------
DROP TABLE IF EXISTS `jshop_user_tocash`;
CREATE TABLE `jshop_user_tocash` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT 'ID号',
  `shop_id` int(10) unsigned DEFAULT NULL COMMENT '商铺id',
  `user_id` int(10) unsigned DEFAULT NULL COMMENT '用户ID',
  `money` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '提现金额',
  `bank_name` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '银行名称',
  `bank_code` varchar(12) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '银行缩写',
  `bank_area_id` int(10) unsigned DEFAULT NULL COMMENT '账号地区ID',
  `account_bank` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '开户行',
  `account_name` varchar(60) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '账户名',
  `card_number` varchar(30) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '卡号',
  `withdrawals` decimal(8,2) unsigned NOT NULL DEFAULT '0.00' COMMENT '提现服务费',
  `type` smallint(1) unsigned NOT NULL DEFAULT '1' COMMENT '1默认，2提现成功，3提现失败',
  `ctime` bigint(12) unsigned DEFAULT NULL COMMENT '创建时间',
  `utime` bigint(12) unsigned DEFAULT NULL COMMENT '更新时间',
  `role` smallint(1) NOT NULL DEFAULT '1' COMMENT '1默认会员  2店铺提现',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT;
-- ----------------------------
-- Records of jshop_user_tocash
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_user_token
-- ----------------------------
DROP TABLE IF EXISTS `jshop_user_token`;
CREATE TABLE `jshop_user_token` (
  `token` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci NOT NULL,
  `user_id` int(10) unsigned NOT NULL,
  `platform` smallint(2) NOT NULL DEFAULT '1' COMMENT '平台类型，1就是默认，2就是微信小程序',
  `ctime` bigint(12) unsigned NOT NULL,
  PRIMARY KEY (`token`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT COMMENT='用户token';
-- ----------------------------
-- Records of jshop_user_token
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_user_transfer
-- ----------------------------
DROP TABLE IF EXISTS `jshop_user_transfer`;
CREATE TABLE `jshop_user_transfer` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '转账id',
  `src_user_id` int(10) unsigned DEFAULT NULL COMMENT '转出会员  关联user.id',
  `src_finance_type` tinyint(1) DEFAULT NULL COMMENT '转出账户类型',
  `dst_user_id` int(10) unsigned DEFAULT NULL COMMENT '转入会员  关联user.id',
  `dst_finance_type` tinyint(1) unsigned DEFAULT NULL COMMENT '转入账户类型',
  `money` decimal(16,2) DEFAULT '0.00' COMMENT '转账金额',
  `tax` decimal(16,2) DEFAULT '0.00' COMMENT '手续费',
  `is_verify` tinyint(1) DEFAULT '1' COMMENT '是否审核 1审核 0未审核  默认1',
  `remark` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_general_ci DEFAULT NULL COMMENT '备注',
  `ctime` bigint(12) DEFAULT NULL COMMENT '创建时间',
  `type` tinyint(1) DEFAULT '1' COMMENT '类型 1 转账 2 兑换 默认1',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC;
-- ----------------------------
-- Records of jshop_user_transfer
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_user_upgrade
-- ----------------------------
DROP TABLE IF EXISTS `jshop_user_upgrade`;
CREATE TABLE `jshop_user_upgrade` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '升级记录id',
  `user_id` int(10) DEFAULT NULL COMMENT '会员id 关联user.id',
  `upgrade_type` tinyint(1) DEFAULT NULL COMMENT '会员类型  关联user_grade.id',
  `is_verify` tinyint(1) DEFAULT '0' COMMENT '审核状态 1未审核 0 已审核',
  `upgrade_old_type` tinyint(1) DEFAULT NULL COMMENT '原会员类型  关联user_grade.id',
  `money` decimal(16,2) DEFAULT '0.00' COMMENT '升级金额',
  `ctime` bigint(12) unsigned DEFAULT NULL COMMENT '申请时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_general_ci ROW_FORMAT=DYNAMIC COMMENT='会员升级记录表(新增)';
-- ----------------------------
-- Records of jshop_user_upgrade
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_user_wx
-- ----------------------------
DROP TABLE IF EXISTS `jshop_user_wx`;
CREATE TABLE `jshop_user_wx` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT COMMENT '用户ID',
  `type` tinyint(1) unsigned DEFAULT '1' COMMENT '第三方登录类型，1微信小程序，2微信公众号',
  `user_id` int(10) unsigned NOT NULL DEFAULT '0' COMMENT '关联用户表',
  `openid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `session_key` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `unionid` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL,
  `avatar` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '头像',
  `nickname` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '昵称',
  `gender` smallint(1) unsigned NOT NULL DEFAULT '0' COMMENT '性别 0：未知、1：男、2：女',
  `language` varchar(50) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '语言',
  `city` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '城市',
  `province` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '省',
  `country` varchar(80) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '国家',
  `country_code` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '手机号码国家编码',
  `mobile` varchar(20) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '手机号码',
  `ctime` bigint(12) unsigned DEFAULT NULL,
  `utime` bigint(12) unsigned DEFAULT NULL,
  `update` smallint(1) unsigned DEFAULT '0' COMMENT '是否更新 0未更新1更新',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB AUTO_INCREMENT=10115 DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT COMMENT='用户表';
-- ----------------------------
-- Records of jshop_user_wx
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_weixin_author
-- ----------------------------
DROP TABLE IF EXISTS `jshop_weixin_author`;
CREATE TABLE `jshop_weixin_author` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `nick_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '授权方昵称',
  `head_img` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '授权方头像',
  `service_type_info` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '0' COMMENT '默认为0',
  `verify_type_info` tinyint(1) DEFAULT '-1' COMMENT '授权方认证类型，-1代表未认证，0代表微信认证',
  `user_name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '小程序的原始ID',
  `signature` tinytext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '帐号介绍',
  `principal_name` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '小程序的主体名称',
  `business_info` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '用以了解以下功能的开通状况（0代表未开通，1代表已开通）： open_store:是否开通微信门店功能 open_scan:是否开通微信扫商品功能 open_pay:是否开通微信支付功能 open_card:是否开通微信卡券功能 open_shake:是否开通微信摇一摇功能',
  `qrcode_url` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '二维码图片的URL',
  `authorization_info` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '授权信息',
  `appid` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '授权方appid',
  `appsecret` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '授权方AppSecret',
  `miniprograminfo` tinytext CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '可根据这个字段判断是否为小程序类型授权,有值为小程序',
  `func_info` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '小程序授权给开发者的权限集列表，ID为17到19时分别代表： 17.帐号管理权限 18.开发管理权限 19.客服消息管理权限 请注意： 1）该字段的返回不会考虑小程序是否具备该权限集的权限（因为可能部分具备）',
  `authorizer_refresh_token` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '刷新token',
  `authorizer_access_token` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT 'token',
  `bind_type` tinyint(1) unsigned DEFAULT '2' COMMENT '绑定类型，1为第三方授权绑定，2为自助绑定',
  `author_type` varchar(10) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT 'b2c' COMMENT '授权类型，默认b2c',
  `expires_in` int(10) unsigned DEFAULT '0' COMMENT '绑定授权到期时间',
  `ctime` int(10) unsigned DEFAULT '0' COMMENT '小程序授权时间',
  `utime` int(10) unsigned DEFAULT '0' COMMENT '小程序更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT COMMENT='获取授权方的帐号基本信息表';
-- ----------------------------
-- Records of jshop_weixin_author
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_weixin_media_message
-- ----------------------------
DROP TABLE IF EXISTS `jshop_weixin_media_message`;
CREATE TABLE `jshop_weixin_media_message` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `title` varchar(200) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '标题',
  `author` varchar(100) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '作者',
  `brief` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '摘要',
  `image` char(32) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '封面',
  `content` text CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci COMMENT '文章详情',
  `url` varchar(255) CHARACTER SET utf8mb4 COLLATE utf8mb4_0900_ai_ci DEFAULT NULL COMMENT '原文地址',
  `ctime` bigint(12) DEFAULT '0' COMMENT '创建时间',
  `utime` bigint(12) DEFAULT '0' COMMENT '更新时间',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT COMMENT='微信图文消息表';
-- ----------------------------
-- Records of jshop_weixin_media_message
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_weixin_menu
-- ----------------------------
DROP TABLE IF EXISTS `jshop_weixin_menu`;
CREATE TABLE `jshop_weixin_menu` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `menu_id` int(10) NOT NULL COMMENT '菜单id',
  `pid` int(10) NOT NULL DEFAULT '0' COMMENT '父级菜单',
  `name` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '菜单名称',
  `type` varchar(11) CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '菜单类型',
  `params` text CHARACTER SET utf8 COLLATE utf8_general_ci NOT NULL COMMENT '菜单参数',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT COMMENT='微信公众号菜单表';
-- ----------------------------
-- Records of jshop_weixin_menu
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_weixin_message
-- ----------------------------
DROP TABLE IF EXISTS `jshop_weixin_message`;
CREATE TABLE `jshop_weixin_message` (
  `id` int(10) NOT NULL AUTO_INCREMENT,
  `name` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '消息名称',
  `type` tinyint(1) DEFAULT '1' COMMENT '消息类型1:文本消息，2:图文消息',
  `params` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '消息参数',
  `ctime` bigint(12) DEFAULT '0' COMMENT '创建时间',
  `utime` bigint(12) DEFAULT '0' COMMENT '更新时间',
  `is_attention` tinyint(1) DEFAULT '2' COMMENT '关注回复，1是关注回复，2不是关注回复',
  `is_default` tinyint(1) DEFAULT '2' COMMENT '是否默认回复，1是，2不是',
  `enable` tinyint(1) DEFAULT '1' COMMENT '1启用，2禁用',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT COMMENT='微信消息表';
-- ----------------------------
-- Records of jshop_weixin_message
-- ----------------------------

-- ----------------------------
-- Table structure for jshop_weixin_publish
-- ----------------------------
DROP TABLE IF EXISTS `jshop_weixin_publish`;
CREATE TABLE `jshop_weixin_publish` (
  `id` int(10) unsigned NOT NULL AUTO_INCREMENT,
  `template_id` int(10) unsigned DEFAULT '0' COMMENT '模板id，不是第三方平台模板id',
  `ctime` int(10) unsigned DEFAULT '0' COMMENT '购买模板时间',
  `audit_status` tinyint(1) DEFAULT NULL COMMENT '审核状态，其中0为审核成功，1为审核失败，2为审核中,-1为未提交审核',
  `reason` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '审核反馈',
  `publish_status` tinyint(1) DEFAULT '0' COMMENT '发布状态，0未发布，1已发布，2发布成功，3发布失败',
  `publish_msg` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '发布反馈',
  `auditid` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '审核id',
  `ext_json` text CHARACTER SET utf8 COLLATE utf8_general_ci COMMENT '第三方自定义的json',
  `user_version` varchar(50) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT '' COMMENT '代码版本号',
  `user_desc` varchar(200) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '代码描述',
  `appid` varchar(100) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '授权appid',
  `qrcode` varchar(255) CHARACTER SET utf8 COLLATE utf8_general_ci DEFAULT NULL COMMENT '预览二维码',
  PRIMARY KEY (`id`) USING BTREE
) ENGINE=InnoDB DEFAULT CHARSET=utf8mb4 COLLATE=utf8mb4_0900_ai_ci ROW_FORMAT=COMPACT COMMENT='小程序发布审核表';
-- ----------------------------
-- Records of jshop_weixin_publish
-- ----------------------------

